def predict(triples: list[Triple]) -> str:
    """
    Converts a list of triples into a natural language sentence.
    """
    sentence = ""
    subject = ""
    for i, triple in enumerate(triples):
        if i == 0:
            subject = triple.subject
            sentence += f"{subject} "

        predicate = triple.predicate
        object_ = triple.object

        if predicate == "city":
            sentence += f"is a city in {object_}. "
        elif predicate == "country":
            sentence += f"is located in {object_}. "
        elif predicate == "established":
            sentence += f"was established in {object_}. "
        elif predicate == "numberOfStudents":
            sentence += f"has {object_} students. "
        elif predicate == "academicStaffSize":
            sentence += f"has an academic staff of {object_}. "
        else:
            if predicate == "isPartOf":
                sentence += f"is part of {object_}. "
            elif predicate == "hasToItsWest":
                sentence += f"has {object_} to its west. "
            elif predicate == "hasToItsNortheast":
                sentence += f"has {object_} to its northeast. "
            elif predicate == "capital":
                sentence += f"has {object_} as its capital. "
            elif predicate == "leader":
                sentence += f"is led by {object_}. "
            elif predicate == "river":
                sentence += f"has the {object_} river. "
            elif predicate == "anthem":
                sentence += f"has the anthem {object_}. "
            elif predicate == "affiliation":
                sentence += f"is affiliated with {object_}. "
            elif predicate == "campus":
                sentence += f"has a campus at {object_}. "
            else:
                if i > 0:
                    sentence += ", "
                sentence += f"{predicate} is {object_}."

    return sentence
